import me3 from "../images/me3.png";
import me2 from "../images/me2.png";
import me1 from "../images/me1.png";

function Info() {
  return (
    <div>
      <img src={me3} className="card-img-top" alt="my face" />
      <div className="card-body">
        <h5 className="card-title">Jarome Eyken</h5>
        <p className="card-text">Full-Stack Developer</p>
        <p className="info--website"></p>
        <div className="card--buttons">
          <a href="mailto: eykenj@gmail.com" className="btn btn-light">
            <i className="fa-solid fa-envelope"></i>
            Email
          </a>
          <a
            href="https://www.linkedin.com/in/jarome-eyken-1a8a2318b/"
            className="btn btn-primary"
          >
            <i className="fa-brands fa-linkedin"></i>
            LinkedIn
          </a>
        </div>
      </div>
    </div>
  );
}

export default Info;
